import React, { Component } from "react";

const MovieComponent = (props) => {
    return (
        <div id="movieComponentId">
            {props.moviedetails}
            {
                props.mapdetails.map((item, i) =>
                    <p>{item}</p>
                )
            }

        </div>
    )
}
export default MovieComponent;
